import React from 'react'; 
import './PromotionPrompt.css';

const PromotionPrompt = ({onClick, color}) => {
	return 
		<div className='promotion_prompt'>
			<div className={`option q piece ${color}`} onClick={()=>onClick('q')} />
			<div className={`option n piece ${color}`}  onClick={()=>onClick('n')} />
			<div className={`option r piece ${color}`}  onClick={()=>onClick('r')} />
			<div className={`option b piece ${color}`} onClick={()=>onClick('b')} />
		</div>;
}
export default PromotionPrompt;
